import Endpoint from ".";

const baseUrl = "http://localhost:8080";

const post = (async (endpointUrl: Endpoint, body: string) => {
    window.fetch(baseUrl + endpointUrl, {
    method: 'POST',
    headers: {
      'content-type': 'application/json;charset=UTF-8',
    },
    body: body,
  }).then(result => {
      console.log(result);
      return result;
  }).catch(err => {
      console.log(err);
      return err
  });
});

export default post;
